import "./TileArea.css";
import User from "./User";
import UserJob from "./UserJob";

function TileArea (props) {
    return (
        
        <div className="tile">
            <div>
                <h2>Hi</h2>
                <p>This is the thing that I'm trying to display</p>
                <User name={props.name}/>
                <UserJob job={props.job}/>
            </div>    
        </div>
    );
}

export default TileArea;
